import React from 'react';
import {Container, Row, Form, FormControl, FormLabel, Button, FormGroup} from 'react-bootstrap';

class App extends React.Component {
  constructor(props) {
    super(props);
      this.state = {
          username: "",
          password: ""
      };
    }
    render(){
      return (
        <div>
            <Container>
              {/*insert form */}
              <Row>
                <Form>
                  <FormGroup>
                    <FormLabel>Username</FormLabel>
                    <FormControl type= "text" name= "username" placeholder= "Enetr Username" value= {this.props.username}></FormControl>
                  </FormGroup>
                  <FormGroup>
                    <FormLabel>Password</FormLabel>
                    <FormControl type= "password" name= "password" placeholder= "Enetr Password" value= {this.props.password}></FormControl>
                  </FormGroup>
                  <Button>Login</Button>
                </Form>
              </Row>
            </Container>
        </div>
      )
    }
  }

  export default App;
